import React from "react";

function CreateUserForm({newUsername, onChangeUsername, newPassword, onChangePassword, newProfileImg, onChangeProfileImg}) {

    return (
        <div>
            <form>
                <input onChange={onChangeUsername}  value={newUsername} type="text" placeholder="username..." />
                <input onChange={onChangePassword} value={newPassword} type="password" placeholder="password" />
                <input onChange={onChangeProfileImg} value={newProfileImg} type="text" placeholder="profile picture url..." />
            </form>
        </div>
    )
}

export default CreateUserForm
